import React from "react";
import "./Login.css";
import { Link } from "@material-ui/core";

function Login() {
  return (
    <div className="login">
        <Link to="/">
      <img className="login_logo"
        src="https://i.insider.com/539f3ffbecad044276726c01?width=1100&format=jpeg&auto=webp"
        alt=""
      />
      </Link> 
    </div>
  );
}

export default Login;
